	add("chikungunya", "{\"term\":\"chikungunya\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|kde|chikungunya||that which bends up|lang\u003den}}, apparently referring to the arthrosis|arthritic effects of the disease.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A viral fever caused by an alphavirus spread by mosquito bites\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Didier Fontenille, Anna Bella Failloux, Roberto Romi, \u0027Should we expect \u0027\u0027Chikungunya\u0027\u0027 and Dengue in Southern Europe?\u0027, Willem Takken, Bart G. J. Knols (editors), \u0027Emerging Pests and Vector-borne Diseases in Europe\u0027, [http://books.google.com.au/books?id\u003dBEs_2o58GSkC\u0026amp;pg\u003dPA169\u0026amp;dq\u003d%22chikungunya%22%7C%22chikungunyas%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dtj1iU7rnJoX28QWkv4GYBQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chikungunya%22%7C%22chikungunyas%22\u0026amp;f\u003dfalse page 169\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Chikungunya\u0027\u0027 and dengue arboviral diseases are in expansion throughout the world\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Stephen A. Berger, \u0027Infectious Diseases of Zimbabwe\u0027, [http://books.google.com.au/books?id\u003dSmofSKBd1iUC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22chikungunya%22%7C%22chikungunyas%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dtj1iU7rnJoX28QWkv4GYBQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chikungunya%22%7C%22chikungunyas%22\u0026amp;f\u003dfalse page 55\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fever of \u0027\u0027Chikungunya\u0027\u0027 is characterized by a rapid rise in temperature to as high as 40 C, often accompanied by rigors, myalgia, headache, photophobia, retro-orbital pain, sore throat with objective signs of pharyngitis, nausea, and vomiting\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Franz J. Conraths, Thomas C. Mettenleiter, \u0027Chapter 13: Infectious Diseases Under the Influence of Changing Environmental Factors\u0027, [http://books.google.com.au/books?id\u003dIFy_KhR2D78C\u0026amp;pg\u003dPA256\u0026amp;dq\u003d%22chikungunya%22%7C%22chikungunyas%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dtj1iU7rnJoX28QWkv4GYBQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chikungunya%22%7C%22chikungunyas%22\u0026amp;f\u003dfalse page 256\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Chikungunya\u0027\u0027 infections are caused by an alphavirus from the family \u0027\u0027Togaviridae\u0027\u0027.Category:en:Diseases\", \"priority\":10}]}, \"synonyms\":{}}");

	add("child", "{\"term\":\"child\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"gothic\", \"Icelandic\", \"Sanskrit\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) {{m|ang|ƒãild||child, infant, youth of gentle birth}}, from Proto-germanic {{m|gem-pro|*kel√æaz||child in the womb, fruit of the womb, child}}, from Proto-indo-european {{m|ine-pro|*g(\u0027)elt-||womb}}. Cognate with Danish {{m|da|kuld||brood, litter}}, Swedish {{m|sv|kull||brood, litter}}, Icelandic {{m|is|kelta}}, {{m|is|kjalta||lap}}, Gothic {{m|got|êå∫êåπêåªêå∏êå¥êåπ||womb}}, Sanskrit {{m|sa|‡§ú‡§∞‡•ç‡§§||tr\u003djarta}}, {{m|sa|‡§ú‡§∞‡•ç‡§§‡•Å||tr\u003dj√°rtu|vulva}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person below the age of adulthood; a minor (generally below 18 years of age or below the legal age of responsibility or accountability\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s daughter or son; an offspring\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An offspring; one born in, or considered a product of the culture of, a place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Mary Jane Matz, \u0027The Many Lives of Otto Kahn: A Biography\u0027, page 5\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"For more than forty years, he preached the creed of art and beauty. He was heir to the ancient wisdom of Israel, a \u0027\u0027child\u0027\u0027 of Germany, a subject of Great Britain, later an American citizen, but in truth a citizen of the world\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A member of a tribe, a people or a race of beings; one born into or considered a product of a people\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Edward John Moreton Dunsany, \u0027Tales of Wonder\u0027, page 64\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Plash-Goo was of the \u0027\u0027children\u0027\u0027 of the giants, whose sire was Uph. And the lineage of Uph had dwindled in bulk for the last five hundred years, till the giants were now no more than fifteen foot high; but Uph ate elephant\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A thing or abstraction derived from or caused by something\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, \u0027\u0027, (title\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d19|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/may/27/globalisation-is-about-taxes-too Globalisation is about taxes passage\u003dIt is time the international community faced the reality: we have an unmanageable, unfair, distortionary global tax regime. [\u0026amp;hellip;] It is the starving of the public sector which has been pivotal in America no longer being the land of opportunity ‚Äì with a \u0027\u0027child\u0027\u0027s life prospects more dependent on the income and education of its parents than in other advanced countries\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A data item, process or object which has a subservient or derivative role relative to another data item, process or object\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, John Mongan, ‚ÄéNoah Kindler, ‚ÄéEric Gigu√®re, \u0027Programming Interviews Exposed\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The algorithm pops the stack to obtain a new current node when there are no more \u0027\u0027children\u0027\u0027 (when it reaches a leaf\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A female infant; a girl\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A boy or a \u0027\u0027child\u0027\u0027, I wonder\", \"priority\":17}]}, \"synonyms\":{}}");

	add("chill", "{\"term\":\"chill\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"{{PIE root|en|gel}}Old english (ca. 450-1100) {{m|ang|ƒãele}}, from Proto-germanic {{m|gem-pro|*kaliz}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A moderate, but uncomfortable and penetrating coldness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/4/geothermal-energy Geothermal volume\u003d101|issue\u003d4|magazine\u003d|passage\u003dEnergy has seldom been found where we need it when we want it. Ancient nomads, wishing to ward off the evening \u0027\u0027chill\u0027\u0027 and enjoy a meal around a campfire, had to collect wood and then spend time and effort coaxing the heat of friction out from between sticks to kindle a flame. With more settled people, animals were harnessed to capstans or caged in treadmills to turn grist into meal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sudden penetrating sense of cold, especially one that causes a brief trembling nerve response through the body; the trembling response itself; often associated with illness: \u0027fevers and chills\u0027, or susceptibility to illness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An uncomfortable and numbing sense of fear, dread, anxiety, or alarm, often one that is sudden and usually accompanied by a trembling nerve response resembling the body\u0027s response to biting cold\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An iron mould or portion of a mould, serving to cool rapidly, and so to harden, the surface of molten iron brought in contact with it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The hardened part of a casting, such as the tread of a carriage wheel\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chilaquiles", "{\"term\":\"chilaquiles\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"classical nahuatl\"], \"text\":\"From Spanish \u0027chilaquiles\u0027 from Classical nahuatl\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traditional Mexican dish of fried tortilla chips topped with salsa.Category:en:Foods\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chilblain", "{\"term\":\"chilblain\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chill|blain|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An itchy purple red inflammation of the skin, especially of the hands, feet and ears. It occurs when capillaries below the skin are damaged by exposure to cold weather\", \"priority\":1}]}, \"synonyms\":{}}");

	add("childcare", "{\"term\":\"childcare\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|child|care|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act, practice, or occupation of supervising and taking care of young children\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027 Amitai Etzioni - The parenting defici\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Today most \u0027\u0027childcare\u0027\u0027 centres are woefully understaffed with poorly paid and underqualified personnel. Child care workers in both the USA and UK are in the lowest tenth of all wage earners\", \"priority\":3}]}, \"synonyms\":{}}");

