	add("childhood", "{\"term\":\"childhood\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027childhod\u0027 from Old english (ca. 450-1100) {{m|ang|ƒãildhƒÅd||childhood}}, from {{m|ang|ƒãild||child}} + {{m|ang|-hƒÅd||-hood}}, equivalent to {{suffix|child|hood|lang\u003den|nocat\u003d1}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a child\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/5/lifelong-impact-of-early-self-control Lifelong Impact of Early passage\u003dTo our own surprise, our 40-year study of 1,000 children revealed that \u0027\u0027childhood\u0027\u0027 self-control strongly predicts adult success, in people of high or low intelligence, in rich or poor, and does so throughout the entire population, with a step change in health, wealth, and social success at every level of self-control\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The time during which one is a child, from between infancy and puberty\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dHe stood transfixed before the unaccustomed view of London at night time, a vast panorama which reminded him [\u0026amp;hellip;] of some wood engravings far off and magical, in a printshop in his \u0027\u0027childhood\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The early stages of development of something\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027childhood\u0027\u0027 of our joy\", \"priority\":7}]}, \"synonyms\":{}}");

	add("childishness", "{\"term\":\"childishness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|childish|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being childish\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Childish behaviour\", \"priority\":2}]}, \"synonyms\":{}}");

	add("childism", "{\"term\":\"childism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|child|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prejudice and/or discrimination against the young\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"To speak of \u0026quot;\u0027\u0027childism\u0027\u0027\u0026quot; is to court derision, and conjure a nightmarish totem of the bolshy teen threatening to call ChildLine when his parent or teacher scolds him\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A systemic condition that promotes stereotypes of the young\", \"priority\":3}]}, \"synonyms\":{}}");

