	add("children", "{\"term\":\"children\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027children\u0027 alteration of earlier \u0027childre\u0027 {{gloss|\u0026quot;children\u0026quot;; \u0026gt; English dialectal \u0027childer\u0027 }, from Old english (ca. 450-1100) {{m|ang|ƒãildru}}, {{m|ang|ƒãildra||children}}, nominative and accusative plural of {{m|ang|ƒãild||child}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d7|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‚Äò\u0027\u0027Children\u0027\u0027 crawled over each other like little grey worms in the gutters,‚Äô he said. ‚ÄòThe only red things about them were their buttocks and they were raw. Their faces looked as if snails had slimed on them and their mothers were like great sick beasts whose byres had never been cleared.\u0026amp;nbsp;[‚Ä¶]‚Äô\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d1|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/07/obama-apple-google-facebook-tainted-prism Obama\u0027s once hip brand is now passage\u003dNow we are liberal with our innermost secrets, spraying them into the public ether with a generosity our forebears could not have imagined. Where we once sent love letters in a sealed envelope, or stuck photographs of our \u0027\u0027children\u0027\u0027 in a family album, now such private material is despatched to servers and clouds operated by people we don\u0027t know and will never meet\", \"priority\":2}]}, \"synonyms\":{}}");

