	add("childship", "{\"term\":\"childship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|child|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or relation of being a child\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Why should any man then doubt of his \u0027\u0027childship\u0027\u0027, doubt of his own everlasting condition, and say, that he is none of the child of God because he is tempted\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chileanism", "{\"term\":\"chileanism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* {{suffix|Chilean|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A term or linguistic feature originating from or specific to the Chilean variety of the Spanish language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Chinanga\u0027 is, according to Rom√°n\u0027s \u0027Diccionario de chilenismos\u0027, not so much a \u0027\u0027Chileanism\u0027\u0027 as an Americanism, since he credits it to Chile, Per√∫ and Ecuador: it is equivalent to the Spanish \u0027taberna\u0027, but enlivened with song and dance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The verb \u0027pechar\u0027 is a \u0027\u0027Chileanism\u0027\u0027 derived from \u0027pecho\u0027, or chest, and means to employ much effort to accomplish a particular goal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Curco\u0027 is a \u0027\u0027Chileanism\u0027\u0027, meaning literally to be bent over with an irritating burden\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Chilean nationalism\", \"priority\":5}]}, \"synonyms\":{}}");

