	add("chiliagon", "{\"term\":\"chiliagon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Greek œáŒπŒªŒπŒ±Œ≥œâŒΩŒøœÇ, from œáŒØŒªŒπŒøŒπ ‚Äòthousand‚Äô + Œ≥œâŒΩŒØŒ± ‚Äòangle‚Äô.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"rare\u0027) A polygon with a thousand vertices and a thousand edges\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027: If Kant\u0027s claim is just that it is impossible to have a sensory experience of the absence of space, then by contrast it is not impossible to have a sensory experience of a \u0027\u0027chiliagon\u0027\u0027. ‚Äî Lorne Falkenstein, \u0027Kant\u0027s Intuitionism\u0027 (Toronto 2004, p. 198\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chiliahedron", "{\"term\":\"chiliahedron\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polyhedron bounded by a thousand plane surfaces\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chiliasm", "{\"term\":\"chiliasm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027œáŒπŒªŒπŒ±œÉŒºœåœÇ\u0027 () from \u0027œáŒØŒªŒπŒøŒπ\u0027 (thousand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Belief in an earthly thousand-year period of peace and prosperity, sometimes equated with the return of Jesus for that period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, Gershom Gerhard Scholem (translated by R. J. Zwi Werblowsky), \u0027Sabbatai Sevi: The Mystical Messiah, 1626-1676‚Äé\u0027, page 10\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was, however, in the Puritan movement in England, and in similar movements on the continent ‚Äî especially the Bohemian Brethren ‚Äî that \u0027\u0027chiliasm\u0027\u0027 asserted its greatest vitality as an historical force\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Colin Loader, \u0027The Intellectual Development of Karl Mannheim\u0027, page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of them, bureaucratic conservatism, represented the routinized sphere of administration, whereas the other, \u0027\u0027chiliasm\u0027\u0027, gave rise to the utopian consciousness and modern politics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Detlef Garbe, \u0027Between Resistance and Martyrdom: Jehovah\u0027s Witnesses in the Third Reich‚Äé\u0027, page 4\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It is a known fact that Bolshevism has unmistakable characteristics of apocalyptic \u0027\u0027chiliasm\u0027\u0027, albeit misinterpreted in a physical, earthly way\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chilipoda", "{\"term\":\"chilipoda\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A class of insects that have one pair of long antennae, a flat segmented body, two body parts: head-thorax and abdomen, one pair of legs per segment, and a poisonous bite. (Examples: centipede\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chilliness", "{\"term\":\"chilliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chilly|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or sensation of being chilly; a disagreeable sensation of coldness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chills", "{\"term\":\"chills\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of being cold, a symptom of many conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chillun", "{\"term\":\"chillun\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Spelling representing a Black or Southern U.S. pronunciation of children.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"child\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chilver", "{\"term\":\"chilver\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027cilfor\u0027 (or \u0027ceolfor\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female lamb\", \"priority\":1}]}, \"synonyms\":{}}");

