	add("chimaera", "{\"term\":\"chimaera\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003dmul}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the many fantastical offspring (fe. Cerberus and the ) of Typhon and Echidna, a multi-headed monster often represented as vomiting flames with the head of a lion, the body (and additional head) of a goat, and a serpent for a tail. Killed by the hero Bellerophon in Lycea\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chimera", "{\"term\":\"chimera\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027chimere\u0027 from Latin \u0027chimaera\u0027 from Ancient greek (to 1453) \u0027sc\u003dpolytonic\u0027 The fabulous monster in Lycia (with a lion\u0027s head, a goat\u0027s body, and a serpent\u0027s tail), supposedly personification of snow or winter, originally \u0026quot;year-old she-goat\u0026quot;, from \u0027sc\u003dpolytonic|œáŒµ·øñŒºŒ±\u0027 (winter season) Meaning \u0026quot;wild fantasy\u0026quot; first recorded 1587.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Chimera, or any fantastic creature with parts from different animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything composed of very disparate part\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He built himself a \u0027\u0027chimera\u0027\u0027: half , half Porsche\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A vain, foolish, or incongruous fancy, or creature of the imagination; as, the chimera of an autho\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An organism with genetically distinct cells originating from two zygote\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A grotesque, like a gargoyle but without a spout for rainwate\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"usually \u0027chimaera\u0027) A cartilaginous marine fish in the subclass Holocephali and especially the order Chimaeriformes, with a blunt snout, long tail, and a spine before the first dorsal fin\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chimere", "{\"term\":\"chimere\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027chimarre\u0027 from Spanish \u0027zamarra\u0027 Cognate with French \u0027chamarre\u0027 \u0027simarre\u0027 Italian \u0027zimarra\u0027 of same origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The upper robe worn by some bishops of the Anglican communion, usually without sleeves\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chimney", "{\"term\":\"chimney\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{borrowing|fro|cheminee|lang\u003den}}, from Latin {{m|la|caminus}}, from Ancient greek (to 1453) {{m|grc|Œ∫Œ¨ŒºŒπŒΩŒøœÇ||furnace}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vertical tube or hollow column used to emit environmentally polluting gaseous and solid matter (including but not limited to by-products of burning carbon or hydro-carbon based fuels); a flue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883:\u0027\u0027 w:Robert Louis Robert Louis Stevenson, \u0027w:Treasure Treasure Island\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Our \u0027\u0027chimney\u0027\u0027 was a square hole in the roof: it was but a little part of the smoke that found its way out, and the rest eddied about the house, and kept us coughing and piping the eye\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The glass flue surrounding the flame of an oil lamp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The smokestack of a steam locomotive\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A narrow cleft in a rock face; a narrow vertical cave passage\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chimpanzee", "{\"term\":\"chimpanzee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The first recorded use of the name \u0027chimpanzee\u0027 dates to 1738. The name is derived from an unspecified Bantu language of Angola, comparable to Vili (Civili, Zone H) \u0027ci-mpenzi\u0027 \u0026lt;ref\u0026gt;\u0026quot;chimpanzee\u0026quot; in American Heritage Dictionary of the English Language, Fifth Edition, Houghton Mifflin Harcourt Publishing Company, 2011.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A great ape of the genus \u0027Pan\u0027, native to Africa, and believed by biologists to be the closest extant relative to humans\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chinaman", "{\"term\":\"chinaman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Chinese Pidgin English. A calque of Chinese \u0027‰∏≠Âúã‰∫∫\u0027 {{suffix|China|man|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who is Chinese\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1872\u0027\u0027, w:Mark Mark Twain, \u0027w:Roughing Roughing It\u0027, 2007, [http://books.google.com.au/books?id\u003dgjUOvGeK51MC\u0026amp;pg\u003dPA169\u0026amp;dq\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH-rpUv3zHoSCkQWs3oGIBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;f\u003dfalse page 169\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A disorderly \u0027\u0027Chinaman\u0027\u0027 is rare, and a lazy one does not exist. So long as a \u0027\u0027Chinaman\u0027\u0027 has strength to use his hands he needs no support from anybody; white men often complain of want of work, but a \u0027\u0027Chinaman\u0027\u0027 offers no such complaint; he always manages to find something to do.Any white man can swear a \u0027\u0027Chinaman‚Äôs\u0027\u0027 life away in the courts, but no \u0027\u0027Chinaman\u0027\u0027 can testify against a white man\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, Hubert D. Russell (editor), \u0027Complete Story of the San Francisco Horror, 1906\u0027, 2003, [http://books.google.com.au/books?id\u003drV0vQgaH_eQC\u0026amp;pg\u003dPA251\u0026amp;dq\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH-rpUv3zHoSCkQWs3oGIBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;f\u003dfalse page 251\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Another favorite pastime of the Highbinder who is usually a loafer, is to levy blackmail on a wealthy \u0027\u0027Chinaman\u0027\u0027.If it were not that the \u0027\u0027Chinamen\u0027\u0027 kill only men of their own race and let alone all other men, the citizens of San Francisco would have sacked and burned Chinatown\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, George Ade, \u0027Stories of the Streets and of the Town: From the Chicago Record 1893 - 1900\u0027, reprinted as \u0027\u00272003\u0027\u0027, \u0027Stories of Chicago\u0027, [http://books.google.com.au/books?id\u003diERot8PUEkoC\u0026amp;pg\u003dPA163\u0026amp;dq\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH-rpUv3zHoSCkQWs3oGIBg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;f\u003dfalse page 163\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In Clark Street, where all the nations of the earth dwell together in harmony, one has but to go downstairs to find a \u0027\u0027Chinaman\u0027\u0027. And when found he is washing\", \"priority\":10}]}, \"synonyms\":{}}");

	add("chinatown", "{\"term\":\"chinatown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|China|town|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A district of a city or town (in a country other than China) in which there is a large concentration of Chinese residents and businesses\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chinchilla", "{\"term\":\"chinchilla\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of two small, crepuscular rodents of the genus \u0027Chinchilla\u0027, native to the Andes, prized for their very soft fur and often kept as pets\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jamie Huggins, \u0027Chinchillas - from Pets to Profession\u0027, [http://books.google.com.au/books?id\u003dreeride_m_QC\u0026amp;pg\u003dPA3\u0026amp;dq\u003d%22chinchilla%22%7C%22chinchillas%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ds9vYUuOyNseAlQWynIHgAw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chinchilla%22%7C%22chinchillas%22\u0026amp;f\u003dfalse page 3\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s important to put a lot of thought into owning a \u0027\u0027chinchilla\u0027\u0027 since they have a considerably long lifespan of 10 to 20 years\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Chinchillas\u0027\u0027 are most widely known for their exceptional fur coat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jeff Wyatt, \u0027Chapter 17: Anesthesia and Analgesia in Other Mammals\u0027, Richard E. Fish, Marilyn J. Brown, Peggy J. Danneman, Alicia Z. Karas (editors), \u0027Anesthesia and Analgesia in Laboratory Animals\u0027, [http://books.google.com.au/books?id\u003dzMfSuAuyKwUC\u0026amp;pg\u003dPA469\u0026amp;dq\u003d%22chinchilla%22%7C%22chinchillas%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ds9vYUuOyNseAlQWynIHgAw\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chinchilla%22%7C%22chinchillas%22\u0026amp;f\u003dfalse page 469\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Chinchillas\u0027\u0027 inhabit high elevations (3,000‚Äì5,000m) of the Chilean Andes Mountains. The \u0027\u0027chinchillas\u0027\u0027 kept as pet or research animals in North America are all descendents of 13 founders wild caught in 1927\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Ron E. Banks, Julie M. Sharp, Sonia D. Doss, Deborah A. Vanderford, \u0027Exotic Small Mammal Care and Husbandry\u0027, [http://books.google.com.au/books?id\u003dqgygGOUtPA4C\u0026amp;pg\u003dPA125\u0026amp;dq\u003d%22chinchilla%22%7C%22chinchillas%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ds9vYUuOyNseAlQWynIHgAw\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22chinchilla%22%7C%22chinchillas%22\u0026amp;f\u003dfalse page 125\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Chinchillas\u0027\u0027 are long-lived rodents that are native to South America, primarily Peru, Argentina, Bolivia, and Chile. The \u0027\u0027chinchilla\u0027\u0027 is a hystricomorph (hedgehoglike) rodent closely related to guinea pigs, porcupines, and agoutis (Hrapkiewicz \u0027et al.\u0027, 1998\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The fur of a \u0027\u0027chinchilla\u0027\u0027, used for clothing\", \"priority\":12}]}, \"synonyms\":{}}");

	add("chindia", "{\"term\":\"chindia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|China|India|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"China and India, especially in the context of business and economics\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chinlone", "{\"term\":\"chinlone\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Burmese\"], \"text\":\"From Burmese {{m|my|·ÄÅ·Äº·ÄÑ·Ä∫·Ä∏·Äú·ÄØ·Ä∂·Ä∏}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Burmese ball game incorporating aspects of both sport and dance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chinook", "{\"term\":\"chinook\", \"etymology\":{\"influencers\":[], \"languages\":[\"lower chehalis\", \"English\"], \"text\":\"From Lower chehalis {{m|cea|cÃìin√∫k|pos\u003d\u0027the name of a Chinook village on the {{w|Columbia river}}\u0027}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The descending, warm, dry wind on the eastern side of the Rocky Mountains. The chinook generally blows from the southwest, but its direction may be modified by topography. When it sets in after a spell of intense cold, the temperature may rise by 20‚Äì40¬∞F in 15 minutes due to replacement of a cold air mass with a much warmer air mass in minutes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The chinook salmon (\u0027Oncorhynchus tshawytscha\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chinook", "{\"term\":\"chinook\", \"etymology\":{\"influencers\":[], \"languages\":[\"lower chehalis\", \"English\"], \"text\":\"From Lower chehalis {{m|cea|cÃìin√∫k|pos\u003d\u0027the name of a Chinook village on the {{w|Columbia river}}\u0027}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Native American language of the Penutian family of Oregon and Washington\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Chinook Jargon, a pidgin trade language of the Pacific Northwest composed primarily of words from Chinook proper, English, and French, with some borrowings from other languages\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Native American people whose traditional tribal grounds were along the lower and middle Columbia River\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Chinook\u0027\u0027 sent a hunting party to the south\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chintz", "{\"term\":\"chintz\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\"], \"text\":\"From Hindi \u0027‡§õ‡•Ä‡§Ç‡§ü\u0027 (chƒ´·πÖ·π≠).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A painted or stained calico fabric, originally produced in India, and known for its brightly colored designs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a meerschaum pipe and a jar half-full of wasps and apricot jam. He found some glasses which didn\u0027t look very clean and polished them on a \u0027\u0027chintz\u0027\u0027 window curtain\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chios", "{\"term\":\"chios\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027chios\u0027 from Ancient greek (to 1453) \u0027œáŒØŒøœÇ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one of the Aegean islands of Greec\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"capital of the island\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chips", "{\"term\":\"chips\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Finnish\"], \"text\":\"English \u0027chips\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"potato chips\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipboard", "{\"term\":\"chipboard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chip|board|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A building material made from wood chips compressed and bound with synthetic resin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipewyan", "{\"term\":\"chipewyan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the \u0027\u0027Chipewyan\u0027\u0027 people, a Native American tribe of Central Canada, in the regions of Alberta, Manitoba, Northwest Territories, and Saskatchewan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Northern Athabascan language spoken by this tribe\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chipmaker", "{\"term\":\"chipmaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chip|maker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A company that manufactures integrated circuit chips\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipotle", "{\"term\":\"chipotle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"classical nahuatl\"], \"text\":\"From Spanish {{m|es|chipotle}}, from Classical nahuatl {{m|nci|chƒ´lli||pepper}} + {{m|nci|p≈çctli||smoke}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ripe jalape√±o pepper, dried and smoked for use in cooking\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipset", "{\"term\":\"chipset\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chip|set|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of integrated circuits (\u0026quot;chips\u0026quot;) that are designed to work together, and are usually marketed as a single product\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chirp", "{\"term\":\"chirp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short, sharp or high note or noise, as of a bird or insect\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pulse of signal whose frequency sweeps through a band of frequencies for the duration of the pulse\", \"priority\":2}]}, \"synonyms\":{}}");

