	add("chirurgeon", "{\"term\":\"chirurgeon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) {{m|fro|surgien}}, later respelled to more closely match the Latin {{m|la|chƒ´rurgia}}. More at {{l|en|surgeon}}, {{l|en|surgery}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A doctor or surgeon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1664\u0027\u0027, w:Samuel Samuel Pepys, \u0027s:Diary of Samuel Diary of Samuel Pepys\u0027, January\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At noon to the \u0027Change, and there long, and from thence by appointment took Luellin, Mount, and W. Symons, and Mr. Pierce, the \u0027\u0027chirurgeon\u0027\u0027, home to dinner with me and were merry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1688\u0027\u0027, w:Aphra Aphra Behn, Oroonoko, The Royal Slave\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"All we could do could get no more words from him; and we took care to have him put immediately into a healing bath, to rid him of his pepper, and ordered a \u0027\u0027chirurgeon\u0027\u0027 to anoint him with healing balm, which he suffered, and in some time he began to be able to walk and eat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, William Harrison Ainsworth, George Cruikshank, \u0026amp; Hablot Knight Browne, \u0027[http://books.google.com/books?id\u003dhDoFAAAAQAAJ\u0026amp;pg\u003dPA481\u0026amp;dq\u003dchirurgeon Ainsworth\u0027s Magazine]\u0027, p. 481\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"On the following day, Tresham was seized with a sudden illness, and making known his symptoms to Ipgreve, the \u0027\u0027chirurgeon\u0027\u0027 who attended the prison was sent for, and on seeing him pronounced him dangerously ill, though he was at a loss to explain the nature of his disorder\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027, w:Arthur Conan Arthur Conan Doyle, \u0027s:Micah Micah Clarke\u0027, chapter XXX\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Noting that there was something amiss, he had hurried down for a skilled \u0027\u0027chirurgeon\u0027\u0027, whom he brought out to us under an escort of scythesmen\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027, w:Julia Taft Julia Taft Bayne, \u0027s:Molly Molly Webster\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Ye healthful Potions ye \u0027\u0027Chirurgeon\u0027\u0027 sends from ye gallipots Power out,\u0026lt;br/\u0026gt;Ye bedd vpheaues, ye homs is shaken, \u0026amp; ye stooles are hvrl\u0027d aboute\", \"priority\":11}]}, \"synonyms\":{}}");

