	add("chitin", "{\"term\":\"chitin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027chitine\u0027 from Latin {{m|la|chit≈çn||mollusk}}. See also \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A complex polysaccharide, a polymer of N-acetylglucosamine, found in the exoskeletons of arthropods and in the cell walls of fungi; thought to be responsible for some forms of asthma in humans\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, Arthur Gamgee, [http://books.google.com/books?id\u003dSr9uxO_JJx4C \u0027A Text-book of the Physiological Chemistry of the Animal Body], Macmillan, p. 29\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Chitin\u0027\u0027 usually occurs throughout Invertebrates in the form of an investment to the outermost cellular layer or ectoderm\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027New Scientist\u0027, 11 Sep 2004, p.1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The robot‚Äôs energy source is the sugar in the polysaccharide called \u0027\u0027chitin\u0027\u0027 that makes up a fly‚Äôs exoskeleton\", \"priority\":5}]}, \"synonyms\":{}}");

