	add("chivalry", "{\"term\":\"chivalry\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) \u0027chivalrie\u0027 a late 13th century loan from Old french (842-ca. 1400) word \u0027chevalerie\u0027 \u0026quot;knighthood, chivalry, nobility, cavalry\u0026quot; (11th century), the \u0027-erie\u0027 abstract of \u0027chevaler\u0027 \u0026quot;knight, horseman\u0026quot;, from \u0027caballarius\u0027 (horseman, knight) a derivation from \u0027caballus\u0027 (horse) \u0027caballaria\u0027 (knighthood, status or fief of a knight) dates to the 12th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cavalry; horsemen armed for battle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027A Clash of Kings\u0027, Bantam 2011, p. 529\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‚ÄòMost of the lords who rode with Lord Renly to Storm\u0027s End have gone over banner-and-blade to Stannis, with all their \u0027\u0027chivalry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fact or condition of being a knight; knightly skill, prowess\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ethical code of the knight prevalent in Medieval Europe, having such primary virtues as mercy towards the poor and oppressed, humility, honour, sacrifice, fear of God, faithfulness, courage and utmost graciousness and courtesy to ladies\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Courtesy, respect and honourable conduct between opponents in wartime\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Courteous behaviour, especially that of men towards women\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A tenure of lands by knightly service\", \"priority\":8}]}, \"synonyms\":{}}");

